import React from 'react';
import { ChakraProvider, Box, Grid, GridItem, Heading, Text, Radio, RadioGroup,Input, Button, IconButton, Container, Flex, FormControl, FormLabel, Image } from '@chakra-ui/react';
import { LockIcon, EmailIcon } from '@chakra-ui/icons';
import { FaSun, FaMoon, FaUndo } from "react-icons/fa";
import { Link } from 'react-router-dom';

const AdminLoginPage = () => {
  return (
    <ChakraProvider>
      <Box minHeight="100vh" bgGradient="gray">


      <Box py={4} color="black">
  <Container maxW="container.lg">
    <Flex alignItems="center" justifyContent="space-between">
    
        <Link href="/dashboard">
        <Heading size="lg" p={1} bg="beige" borderRadius="md" _hover={{
        bg: "gray.200",
        cursor: "pointer",
        transform: "scale(1.05)",
        transition: "all 0.3s ease",
      }}>
          {/* Laksh */}
        </Heading>
      </Link>
    
      {/* Add additional interactive elements here */}
      <IconButton
        // icon={<FaUser />}
        aria-label="User Profile"
        variant="ghost"
        _hover={{ color: "Green.500" }}
      />
    </Flex>
  </Container>
</Box>



      
        {/* Header */}
        {/* <Box py={4} color="black">
          <Container maxW="container.lg">
            <Flex alignItems="center" justifyContent="space-between">
              {/* <Image src="/logo.svg" alt="Logo" boxSize="50px" /> */}
              {/* <Heading size="lg" p={1} bg="beige" >Laksh</Heading>
            </Flex>
          </Container>
        </Box>  */}
        



        {/* Main Content */}
        <Flex>
          {/* Left Menu */}
          <div className="main-sidebar sidebar-style-2">
  <aside id="sidebar-wrapper">
    <div className="sidebar-brand">
      <a href="/dashboard">
        <img alt="image" src="/assets/img/logo.png" className="header-logo" style={{ width: "43px", height: "auto" }} />
        <span className="logo-name" style={{ color: "rgb(52, 52, 151)", fontFamily: "'Georgia', sans-serif" }}>Nixcel</span>
      </a>
    </div>
    <ul className="sidebar-menu" style={{ listStyle: "none", paddingLeft: "0" }}>
      <li className="menu-header"></li>
      <li className="dropdown active" style={{ marginTop: "5px" }}>
        <a href="/dashboard" className="nav-link" style={{ color: "black" }}>
          <i data-feather="monitor"></i>
          <span>Dashboard</span>
        </a>
      </li>

      {/* left menu for admin */}
      {user.tbl_role_id === 1 && (
        <>
          <li className="menu-header"></li>
          <li className="dropdown active">
            <a href="/admin/users" className="nav-link" style={{ color: "black" }}>
